import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <main>
      <h1 align="center">Guides</h1>
      <p>We will write comprehensive guides to ensure that beginners can navigate through the NFT ecosystem</p>
    </main>
  );
};

export default Home;
